   "cell_type": "markdown",
   "id": "edc3dcae",
   "metadata": {},
   "source": [
    "Ну и напоследок построим гистограмму частот при помощи ggplot2!\n",
    "\n",
    "Чтобы получить доступ к данным:\n",
    "\n",
    "> install.packages(\"ggplot2\") # если у вас не установлен пакет\n",
    "\n",
    "> library(\"ggplot2\")\n",
    "\n",
    "#теперь данные diamonds доступны для работы\n",
    "\n",
    "> str(diamonds)\n",
    "\n",
    "Основной способ визуализировать распределение частот номинативной переменной - гистограмма частот (барплот). Используя библиотеку ggplot2 и встроенные данные diamonds, постройте график распределения частот переменной color, на котором за цвет заполнения столбиков отвечает переменная cut. Сохраните код графика в переменную obj. В итоге должен получиться вот такой график.\n",
    "![](https://ucarecdn.com/b56c3afe-51b3-4984-864a-e18359335c5a/)\n",
    "\n",
    "Для успешной проверки вашего решения не выводите переменную obj в консоль. Просто сохраните в нее график."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 1,
   "id": "c942b19e",
   "metadata": {},
   "outputs": [],
   "source": [
    "library(\"ggplot2\")\n",
    "obj <- ggplot(diamonds,aes(x = color, fill = cut))+\n",
    " geom_bar(position = \"dodge\")"
   ]
  },
